import React from 'react';
import './App.css';
import { Swithch, Route } from 'react-router-dom';

import HomePage from './pages/homepage/homepage';

const HatsPage = () => (
	<div>
		<h1>Hellllo. This is Hats Page</h1>
	</div>
);


function App() {
  return (
    <div>
    	<Switch>
    		<Route exact path='/' component={HomePage} />
    		<Route exact path='/hats' component={HatsPage} />
    	</Switch>
    </div>
  );
}

export default App;
